            t[j][i] += t[j - 1][i]
    for i in range(1, N + 2):
        for j in range(1, N + 2):
            t[i][j] += t[i - 1][j - 1]
    ans = 0
    for i in range(N):
        for j in range(i + 1):
            if t[i][j] != 0:
                ans += 1
    return ans

